CREATE TABLE BusRoute
(
 RouteId int PRIMARY KEY NOT NULL,
 RouteNo nvarchar(8) NOT NULL,
 RouteName nvarchar(255) NOT NULL,
 InBoundName nvarchar(255) NOT NULL,
 InBoundDescription nvarchar(MAX) NOT NULL,
 OutBoundName nvarchar(255) NOT NULL,
 OutBoundDescription nvarchar(MAX) NOT NULL,
 BusType smallint NOT NULL,
 Distance decimal(12,1) NOT NULL,
 NumOfSeats nvarchar(16) NOT NULL,
 OperationTime nvarchar(32) NOT NULL,
 Tickets nvarchar(255) NOT NULL,
 TotalTrip nvarchar(16) NOT NULL,
 TimeOfTrip nvarchar(16) NOT NULL,
 Headway nvarchar(16) NOT NULL,
 Color nvarchar(16) NOT NULL,
 [Status] smallint NOT NULL
)
CREATE TABLE BusOrg
(
 OrgId int PRIMARY KEY NOT NULL,
 RouteId int FOREIGN KEY REFERENCES BusRoute(RouteId) NOT NULL,
 OrgName nvarchar(255) NOT NULL,
 OrgPhone nvarchar(24) NOT NULL
)
CREATE TABLE GeoZone
(
 ZoneId int PRIMARY KEY NOT NULL,
 ZoneName nvarchar(255) NOT NULL,
 [Status] smallint NOT NULL
)
CREATE TABLE BusStop
(
 StopId int PRIMARY KEY NOT NULL,
 StopType smallint NOT NULL,
 Code nvarchar(255) NOT NULL,
 Name nvarchar(255) NOT NULL,
 ShortName nvarchar(64) NOT NULL,
 AddressNo nvarchar(255) NOT NULL,
 Street nvarchar(255) NOT NULL,
 Ward nvarchar(255) NOT NULL,
 ZoneId int FOREIGN KEY REFERENCES GeoZone(ZoneId) NOT NULL,
 Latitude decimal(12,9) NOT NULL,
 Longitude decimal(12,9) NOT NULL,
 DisabilitySupport bit NOT NULL,
 [Status] smallint NOT NULL
)
CREATE TABLE BusRoutePlan
(
 PlanId int PRIMARY KEY NOT NULL,
 RouteId int FOREIGN KEY REFERENCES BusRoute(RouteId) NOT NULL,
 Name nvarchar(255) NOT NULL,
 ShortName nvarchar(64) NOT NULL,
 Distance decimal(18,12) NOT NULL,
 Outbound bit NOT NULL,
 RunningTime int NOT NULL,
 [Status] smallint NOT NULL
)
CREATE TABLE BusStopDetail
(
 PlanId int FOREIGN KEY REFERENCES BusRoutePlan(PlanId) NOT NULL,
 StopId int FOREIGN KEY REFERENCES BusStop(StopId) NOT NULL,
 OrderNo int NOT NULL,
 PRIMARY KEY (PlanId, StopId)
)
CREATE TABLE BusPathDetail
(
 PlanId int FOREIGN KEY REFERENCES BusRoutePlan(PlanId) NOT NULL,
 OrderNo int NOT NULL,
 Latitude decimal(12,9) NOT NULL,
 Longitude decimal(12,9) NOT NULL,
 PRIMARY KEY (PlanId, OrderNo)
)
CREATE TABLE BusTimeTable
(
 TimeTableId int NOT NULL,
 PlanId int FOREIGN KEY REFERENCES BusRoutePlan(PlanId) NOT NULL,
 ApplyDates nvarchar(32) NOT NULL,
 EndDate datetime NULL,
 Headway nvarchar(255) NOT NULL,
 OperationTime nvarchar(255) NOT NULL,
 RunningTime nvarchar(255) NOT NULL,
 StartDate datetime NOT NULL,
 TotalTrip int NOT NULL,
 [Status] smallint NOT NULL,
 PRIMARY KEY (PlanId, TimeTableId)
)
CREATE TABLE BusTrip
(
 TripId int PRIMARY KEY NOT NULL,
 PlanId int NOT NULL,
 TimeTableId int NOT NULL,
 StartTime time NOT NULL,
 EndTime time NOT NULL,
 FOREIGN KEY (PlanId, TimeTableId) REFERENCES BusTimeTable(PlanId, TimeTableId)
)
